// StatsPage.js
import React from 'react';
import { useLocation } from 'react-router-dom'; // Import useLocation hook from React Router
import videoBg from "./components/bgvideo.mp4";
import './styling/ThankYou.css'; // Import CSS file for styling
import './styling/App.css'; // Import CSS file for styling

const StatsPage = () => {

  const location = useLocation();
  const searchParams = new URLSearchParams(location.search);
  const randomId = searchParams.get('randomId');

  // Placeholder data for the table
  const tableData = [
    { col1: 'Row 1, Col 1', col2: 'Row 1, Col 2', col3: 'Row 1, Col 3' },
    { col1: 'Row 2, Col 1', col2: 'Row 2, Col 2', col3: 'Row 2, Col 3' },
    { col1: 'Row 3, Col 1', col2: 'Row 3, Col 2', col3: 'Row 3, Col 3' },
    { col1: 'Row 4, Col 1', col2: 'Row 4, Col 2', col3: 'Row 4, Col 3' },
    { col1: 'Row 5, Col 1', col2: 'Row 5, Col 2', col3: 'Row 5, Col 3' },
    { col1: 'Row 6, Col 1', col2: 'Row 6, Col 2', col3: 'Row 6, Col 3' },
    { col1: 'Row 7, Col 1', col2: 'Row 7, Col 2', col3: 'Row 7, Col 3' },
    { col1: 'Row 8, Col 1', col2: 'Row 8, Col 2', col3: 'Row 8, Col 3' },
    { col1: 'Row 9, Col 1', col2: 'Row 9, Col 2', col3: 'Row 9, Col 3' },
    { col1: 'Row 10, Col 1', col2: 'Row 10, Col 2', col3: 'Row 10, Col 3' },
  ];

  return (
    <div style={{ position: 'relative', width: '100vw', height: '100vh', overflow: 'hidden' }}>
      {/* Video */}
      <video autoPlay loop muted playsInline style={{ position: 'absolute', top: 0, left: 0, width: '100%', height: '100%', objectFit: 'cover', opacity: '0.8' }} playbackRate={0.25} >
        <source src={videoBg} type="video/mp4"></source>
      </video>

      {/* Overlay content */}
      <div style={{ position: 'absolute', top: 0, left: 0, width: '100%', height: '100%' }}>
        {/* Participant ID */}
        <button className="user-id">{randomId}</button>

        {/* VibeVision text */}
        <div className="vibe-vision">VibeVision</div>

        {/* Table */}
        <div style={{ margin: '20px', backgroundColor: 'rgba(255, 255, 255, 0.8)', padding: '10px', borderRadius: '8px' }}>
          <table style={{ width: '100%', borderCollapse: 'collapse' }}>
            <thead>
              <tr>
                <th style={{ border: '1px solid #ddd', padding: '8px' }}>Column 1</th>
                <th style={{ border: '1px solid #ddd', padding: '8px' }}>Column 2</th>
                <th style={{ border: '1px solid #ddd', padding: '8px' }}>Column 3</th>
              </tr>
            </thead>
            <tbody>
              {tableData.map((row, index) => (
                <tr key={index}>
                  <td style={{ border: '1px solid #ddd', padding: '8px' }}>{row.col1}</td>
                  <td style={{ border: '1px solid #ddd', padding: '8px' }}>{row.col2}</td>
                  <td style={{ border: '1px solid #ddd', padding: '8px' }}>{row.col3}</td>
                </tr>
              ))}
            </tbody>
          </table>
        </div>
      </div>
    </div>
  );
};

export default StatsPage;
